import React, { useEffect } from 'react'
import { useNavigate } from 'react-router-dom'

function Dashboard() {
    const history = useNavigate();
    useEffect(() => {
        if (localStorage.getItem('token')) {
            history("/dashboard")
        }
        else {
            history("/")
        }
    }, [])
    return (
        <div className='row'>
            <div className="col">
                <h1>Left column</h1>
            </div>
            <div className="col">
                <h1>This is a right column</h1>
            </div>

        </div>
    )
}

export default Dashboard
